 // pipeline (ff) to get the pixel color from the array 	 
//////////--------------------------------------------------------------------------------------------------------------= 
always_ff@(posedge clk or negedge resetN) 
begin 
	if(!resetN) begin 
		RGBout <=	8'h00;  
	end 
	else begin 
		RGBout <= TRANSPARENT_ENCODING ; // default  
 
		if (InsideRectangle == 1'b1 ) begin // inside an external bracket
				
				if(coil_state==2'b0) begin
					RGBout <= object_colors[1'b0][offsetY][offsetX];
				end
				if (coil_state==2'b01 && offsetY> 5'd22) begin // do not draw fisrt 23 lines of coil (half pressed)
					RGBout <= object_colors[1'b0][offsetY][offsetX]; 
				end
				if(coil_state==2'b10) begin
					RGBout <= object_colors[1'b1][offsetY][offsetX];
				end
		end  	 
		 
	end 
end 
 
//////////--------------------------------------------------------------------------------------------------------------= 
// decide if to draw the pixel or not 
assign drawingRequest = (RGBout != TRANSPARENT_ENCODING ) ? 1'b1 : 1'b0 ; // get optional transparent command from the bitmpap   
 
endmodule 
